function solve_sudoku() {
  if (solved === false) {
    click_reset();
    whitesmoke();
    blue_font();

    if (count === 0) {
      check_temp();
    }

    solving();
    input_check();
    if (empty === true) {
      if (count <= 1) {
        count = count + 1;
        if (solved === false) solve_sudoku();
      } else if (count === 2) {
        count = count + 1;
        randomizer();
      } else {
        clear_temp();
        if (repeat > 20) {
          notif.innerHTML = "Impossible to Solve";
          notif.style.visibility = "visible";
          impossible();
        } else {
          count = 1;
          repeat += 1;
          if (solved === false) solve_sudoku();
        }
      }
    } else {
      notif.style.visibility = "visible";
      notif.innerHTML = "Solving Ends";
      solved = true;
      solve.innerHTML = "EDIT";
      whitesmoke();
    }
  } else if (solved === true) {
    notif.style.visibility = "visible";
    notif.innerHTML = "Edit Sudoku";
    solved = false;
    solve.innerHTML = "SOLVE";
  }
  keyboard.style.visibility = "hidden";
}

